import React from "react";
import "./styles.css"

function Footer() {
    return (
      <div className="containter" id="footer">
        <div className="card-body text-center">
          <a className="card-text" href="https://github.com/squalolee/GitPets" target="blank">
          GitHub Repo
          </a>
        </div>
      </div>
    );
  }

  export default Footer;
